import React from 'react'
import ReactDOM from 'react-dom'
// import './fruit.css'
import Button from '@material-ui/core/Button'

class Fruit extends React.Component{
    constructor(props){
        super(props);
        this.state = {
          items: [
            {
            name: "Essentials", color: "Sage", price: "$90"
            },
            {
              name: "Ami", color: "Red", price: "$160"
            },
            {
            name: "Acne Studio", color: "Navy", price: "$200"
            }
          ]

        };
      }


    render(){
        return(
            <div>
                <h1 id = 'f'>Name: {this.props.name}</h1>
                <h3>Color: {this.props.color}</h3>
                <h3>Price: {this.props.price}</h3>

                <Button variant="contained" color="primary" disableElevation>
                Add to Cart
                </Button>
            </div>

        )
    }
}


export default WZRY;
